package com.codershop.shoppinganywhere.common.entity;import javax.persistence.*;import java.util.Date;/** * com.fis.fw.core.entity.ScheduleLog * TungHuynh * Created by sondt18@fpt.com.vn * Date 24/06/2019 9:47 AM */@Entity@Table(name = "SCHEDULE_LOG", schema = "ADMIN_DTHGD")public class ScheduleLog {    private static final long serialVersionUID = 1L;    @Id    @Column(name = "SCHEDULE_LOG_ID")    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "SCHEDULE_LOG_SEQ")    @SequenceGenerator(schema = "ADMIN_DTHGD", sequenceName = "SCHEDULE_LOG_SEQ", name = "SCHEDULE_LOG_SEQ", allocationSize = 1)    private Integer scheduleLogId;    @Column(name = "SCHEDULE_CONFIG_ID")    private Integer scheduleConfigId;    @Column(name = "LEVEL_LOG")    private String levelLog;    @Column(name = "CREATE_TIME")    @Temporal(TemporalType.TIMESTAMP)    private Date createTime;    @Column(name = "CONTENT")    private String content;    public Integer getScheduleLogId() {        return scheduleLogId;    }    public void setScheduleLogId(Integer scheduleLogId) {        this.scheduleLogId = scheduleLogId;    }    public Integer getScheduleConfigId() {        return scheduleConfigId;    }    public void setScheduleConfigId(Integer scheduleConfigId) {        this.scheduleConfigId = scheduleConfigId;    }    public String getLevelLog() {        return levelLog;    }    public void setLevelLog(String levelLog) {        this.levelLog = levelLog;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getContent() {        return content;    }    public void setContent(String content) {        this.content = content;    }}